import { PDFDocument, rgb, StandardFonts } from 'pdf-lib';

export async function generarChecklistPDF(data) {
    const { cliente, tecnico, fecha, respuestas, firma_base64 } = data;
    const pdfDoc = await PDFDocument.create();
    const page = pdfDoc.addPage([595.28, 841.89]);
    const { width, height } = page.getSize();
    const font = await pdfDoc.embedFont(StandardFonts.Helvetica);
    const logoImage = await pdfDoc.embedJpg("data:image/jpeg;base64,");

    page.drawImage(logoImage, {
        x: 50,
        y: height - 80,
        width: 150,
        height: 50,
    });

    page.drawText('Checklist de Seguridad', {
        x: 50,
        y: height - 120,
        size: 20,
        font,
        color: rgb(0, 0, 0)
    });

    page.drawText(`Cliente: ${cliente}`, { x: 50, y: height - 160, size: 12, font });
    page.drawText(`Técnico: ${tecnico}`, { x: 50, y: height - 180, size: 12, font });
    page.drawText(`Fecha: ${fecha}`, { x: 50, y: height - 200, size: 12, font });

    let y = height - 240;
    respuestas.forEach(r => {
        page.drawText(`${r.pregunta} - Respuesta: ${r.respuesta}`, {
            x: 50,
            y: y,
            size: 10,
            font
        });
        y -= 20;
    });

    if (firma_base64) {
        const signatureImage = await pdfDoc.embedPng(firma_base64);
        page.drawImage(signatureImage, {
            x: 50,
            y: 100,
            width: 200,
            height: 50,
        });
        page.drawText('Firma del cliente:', {
            x: 50,
            y: 160,
            size: 12,
            font
        });
    }

    const pdfBytes = await pdfDoc.save();
    const blob = new Blob([pdfBytes], { type: 'application/pdf' });
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = `Checklist-${cliente}-${fecha}.pdf`;
    link.click();
}
